(199, 'post01', '<strong style=\"color: rgb(107, 36, 178);\">Để khai hoá bạn cần làm 2 việc ở npc Kamakura : </strong> \r\n <ul>\r\n  <li><em style=\"color: rgb(161, 0, 0);\">Thăng ngưỡng</em> : bạn cần thăng ngưỡng món đồ trước khi thăng cấp</li>\r\n\r\n  <li><em style=\"color: rgb(161, 0, 0);\">Thăng cấp</em> : sau khi thăng ngưỡng xong hãy thăng cấp để đạt chỉ số theo ý thích bản thân</li>\r\n\r\n <li>Hãy sử dụng các loại đá quý phía dưới để thăng cấp cho món đồ yêu thích của bạn</li>\r\n\r\n  <li><em style=\"color: rgb(161, 0, 0);\">Đá Chinh Phục</em> cho trang bị những chỉ số cường hóa sức mạnh</li>\r\n  <li><em style=\"color: rgb(161, 0, 0);\">Đá Vô Thương </em>cho trang bị những chỉ số tăng khả năng phòng ngự</li>\r\n  <li><em style=\"color: rgb(161, 0, 0);\">Đá Phục Sinh </em>cho trang bị những chỉ số sinh lực, hồi phục</li>\r\n\r\n <li>Trong quá trình phiêu lưu trong làng truyền thuyết, bạn sẽ có cơ hội nhận được các loại đá quý như: Đá Chinh Phục, Đá Vô Thương, Đá Phục Sinh, hoặc bạn có thể ăn các vật phẩm sự kiện </li>\r\n\r\n <li>Khi trang bị mới chỉ Thăng Ngưỡng mà chưa Thăng Cấp, các bạn sẽ được chọn 3 loại đá trên để Khai Hóa</li>\r\n\r\n <li>Hãy suy nghĩ thật kĩ trước khi chọn loại đá và hiệu năng cho trang bị, vì khi đã chọn và nâng cấp thành công, các bạn sẽ không thể chọn lại chỉ số khác</li>\r\n </ul>'),
(200, 'post02', '</ul>\r\n<strong style=\"color: rgb(107, 36, 178);\">Để tạo ấn tộc bạn cần gặp npc Katana : </strong> <br>\r\n<em style=\"color: rgb(161, 0, 0);\">Hãy gia nhập 1 gia tộc bất kì sau đó qua npc Katana để có cơ hội nhận được ấn tộc</em>\r\n\r\n <li>Thăng ấn : bạn cần đá linh hồn theo từng cấp và giấy phép nâng cấp</li>\r\n\r\n <li>Dùng ngân lượng để mua giấy phép nâng cấp ấn tộc</li>\r\n\r\n <li>Đá linh hồn rơi ở lãnh địa gia tộc</li>\r\n <b>Cấp 6 / cấp 10 sẽ có hào quang riêng của ấn tộc </b><br><br>\r\n  <em style=\"color: rgb(161, 0, 0);\">Chỉ số ấn tộc :</em>\r\n<ul> \r\n<b>Cấp 1 : </b>\r\n<li> Hp tối đa : 1000</li>\r\n<li> Kháng tất cả : 50</li>\r\n<b>Cấp 2 : </b>\r\n<li> Hp tối đa : 2000</li>\r\n<li> Kháng tất cả : 100</li>\r\n<b>Cấp 3 : </b>\r\n<li> Hp tối đa : 3000</li>\r\n<li> Kháng tất cả : 150</li>\r\n<b>Cấp 4 : </b>\r\n<li> Hp tối đa : 4000</li>\r\n<li> Kháng tất cả : 200</li>\r\n<b>Cấp 5 : </b>\r\n<li> Hp tối đa : 5000</li>\r\n<li> Kháng tất cả : 250</li>\r\n<li> Kháng sát thương chí mạng : 10%</li>\r\n<b>Cấp 6 : </b>\r\n<li> Hp tối đa : 6000</li>\r\n<li> Kháng tất cả : 300</li>\r\n<li> Kháng sát thương chí mạng : 12%</li>\r\n<li> Kháng sát thương hệ hoả : 5%</li>\r\n<li> Kháng sát thương hệ băng : 5%</li>\r\n<li> Kháng sát thương hệ phong : 5%</li>\r\n<b>Cấp 7 : </b>\r\n<li> Hp tối đa : 7000</li>\r\n<li> Kháng tất cả : 350</li>\r\n<li> Kháng sát thương chí mạng : 15%</li>\r\n<li> Kháng sát thương hệ hoả : 7%</li>\r\n<li> Kháng sát thương hệ băng : 7%</li>\r\n<li> Kháng sát thương hệ phong : 7%</li>\r\n<b>Cấp 8 : </b>\r\n<li> Hp tối đa : 8000</li>\r\n<li> Kháng tất cả : 400</li>\r\n<li> Kháng sát thương chí mạng : 18%</li>\r\n<li> Kháng sát thương hệ hoả : 10%</li>\r\n<li> Kháng sát thương hệ băng : 10%</li>\r\n<li> Kháng sát thương hệ phong : 10%</li>\r\n<b>Cấp 9 : </b>\r\n<li> Hp tối đa : 9000</li>\r\n<li> Kháng tất cả : 450</li>\r\n<li> Kháng sát thương chí mạng : 22%</li>\r\n<li> Kháng sát thương hệ hoả : 12%</li>\r\n<li> Kháng sát thương hệ băng : 12%</li>\r\n<li> Kháng sát thương hệ phong : 12%</li>\r\n<b>Cấp 10 : </b>\r\n<li> Hp tối đa : 10000</li>\r\n<li> Kháng tất cả : 500</li>\r\n<li> Kháng sát thương chí mạng : 25%</li>\r\n<li> Kháng sát thương hệ hoả : 15%</li>\r\n<li> Kháng sát thương hệ băng : 15%</li>\r\n<li> Kháng sát thương hệ phong : 15%</li>\r\n\r\n</ul>\r\n\r\n\r\n\r\n<em style=\"color: rgb(161, 0, 0);\">Bạn có thể ghép đá linh hồn bằng cách phù phép từ trượng  :\r\n</em>\r\n <li>Đá linh hồn cấp 2 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 1</li>\r\n <li>Đá linh hồn cấp 3 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 2</li>\r\n <li>Đá linh hồn cấp 4 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 3</li>\r\n <li>Đá linh hồn cấp 5 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 4</li>\r\n <li>Đá linh hồn cấp 6 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 5</li>\r\n <li>Đá linh hồn cấp 7 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 6</li>\r\n <li>Đá linh hồn cấp 8 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 7</li>\r\n <li>Đá linh hồn cấp 9 = 1 trượng linh hồn + 5 bụi linh hồn + 10 viên đá linh hồn cấp 8</li>\r\n <li>Trượng linh hồn và bụi linh hồn sẽ có trong vật phẩm sự kiện</li>\r\n\r\n<b>Ấn Tộc sẽ sử dụng vào trang bị 2</b>\r\n</ul>'),
(201, 'post03', '<em style=\"color: rgb(161, 0, 0);\">Để vào được thánh địa anh em vào NPC Goosho để mua Truyền Thuyết Lệnh</em></h5>\r\n <ul>\r\n  <li>Vào gặp NPC Deidara để vào thánh địa</li>\r\n\r\n  <li>Khi tiêu diệt 1 bản sao bạn sẽ nhận được 1 Rương Hắc Ám , khi tiêu diệt 6 bản sao win thánh địa sẽ nhận random chìa khóa</li>\r\n\r\n  <li>Phần thưởng mở Rương Hắc Ám : </li>\r\n  <li>Trang bị 9x </li>\r\n  <li>Vũ khí 9x cho 6 phái </li>\r\n  <li>Và nhiều phần quà hấp dẫn khác</li>\r\n\r\n<b>Lưu ý : mỗi ngày chỉ 1 lần vào thánh địa</b>\r\n</ul>'),
(202, 'post04', ' <ul>\r\n<em style=\"color: rgb(161, 0, 0);\">Chiến trường bao gồm 2 phe</em></h5>\r\n  <li>Hắc giả</li>\r\n  <li>Bạch giả</li>\r\n\r\n<em style=\"color: rgb(161, 0, 0);\">Chiến trường mở cừa mỗi ngày 3 lần với thời gian báo danh là 30 phút và diễn ra trong suốt 60 phút</em></h5>\r\n\r\n  <li>13h00 : Level 30 - 50</li>\r\n  <li>16h00 : Level 30 - 130</li>\r\n  <li>19h00 : Level 70 - 90</li>\r\n\r\n<em style=\"color: rgb(161, 0, 0);\">Cách thức tham gia</em></h5>\r\n\r\n  <li>Gặp NPC Rikudou tại các trường để chọn tham gia Hắc/Bạch giả, sau đó các bạn sẽ được đưa vào map chờ</li>\r\n\r\n  <li>Khi hết 30 phút báo danh, các bạn sẽ có thể di chuyển sang các map để tham gia chiến đấu và dành điểm</li>\r\n\r\n<em style=\"color: rgb(161, 0, 0);\">Công thức tính điểm</em></h5>\r\n\r\n  <li>Quái thường: 1 điểm cho người kết liễu</li>\r\n  <li>Tinh anh: 5 điểm cho người kết liễu</li>\r\n  <li>Thủ lĩnh: 20 điểm cho người kết liễu</li>\r\n  <li>Người: 5 điểm</li>\r\n  <li>Trụ: 500 điểm cho toàn đội</li>\r\n\r\n  <li>Nhiệm vụ của nhẫn giả là bảo vệ trụ của đội mình và đi đánh trụ của đối phương</li>\r\n\r\n  <li>Khi hạ gục được trụ đối phương, toàn đội sẽ được nhận những lợi tức sau : 500 điểm hạ gục</li>\r\n\r\n<em style=\"color: rgb(161, 0, 0);\">Top 3 người có điểm cao nhất trong chiến trường nhận được</em></h5>\r\n\r\n  <li>TOP 1 2 3 : Mặt nạ Thủy Tinh/ Sơn Tinh 3 ngày </li>\r\n  <li>Hãy đổi điểm tích luỹ để nhận rương chiến trường với các phần quà giá trị :</li>\r\n  <li>Rương bạch ngân</li>\r\n  <li>Bát bảo</li>\r\n  <li>100 triệu yên</li>\r\n\r\n </ul>'),
(203, 'post05', ' </ul>\r\n<em style=\"color: rgb(161, 0, 0);\">Chỉ số bí kíp</em>\r\n  <li>Né đòn : max 35</li>\r\n  <li>Chính xác : max 35</li>\r\n  <li>Tấn công : max 1000</li>\r\n  <li>Hoả công : max 600</li>\r\n  <li>Băng công : max 600</li>  \r\n  <li>Phong lôi : max 600</li>\r\n  <li>Phản đòn : max 30</li>\r\n  <li>Chí mạng : max 10 (Chỉ max chỉ số nâng cấp mới tăng thêm)</li>\r\n <li>Kháng băng : max 50</li>\r\n <li>Kháng phong : max 50</li>\r\n <li>Kháng hoả : max 50</li>\r\n  <li>Hp tối đa : max 1000</li>\r\n  <li>Mp tối đa : max 1000</li>\r\n <em style=\"color: rgb(161, 0, 0);\">Chỉ số ruby</em>\r\n  <li>Né đòn : max 84</li>\r\n  <li>Chính xác : max 86</li>\r\n  <li>Tấn công : max 1000</li>\r\n  <li>Hoả công : max 500</li>\r\n  <li>Băng công : max 500</li>  \r\n  <li>Phong lôi : max 500</li>\r\n  <li>Phản đòn : max 50</li>\r\n  <li>Chí mạng : max 10 (Chỉ max chỉ số nâng cấp mới tăng thêm)</li>\r\n <li>Kháng băng : max 100</li>\r\n <li>Kháng phong : max 100</li>\r\n <li>Kháng hoả : max 100</li>\r\n   <li>Hp tối đa : max 600</li>\r\n  <li>Mp tối đa : max 600</li>\r\n<em style=\"color: rgb(161, 0, 0);\">Chỉ số mặt nạ trang bị 2</em>\r\n<li>Tấn công ngoại : max 500</li>\r\n<li> Tấn công nội : max 500</li>\r\n<li> Kháng băng : max 150</li>\r\n<li> Kháng phong : max 150</li>\r\n<li> Kháng hoả : max 150</li>\r\n<li> Né đòn : max 100</li>\r\n<li> Hp tối đa : max 2000</li>\r\n<li>  Vật công ngoại : max 200%</li>\r\n<li>   Vật công nội : max 200%</li>\r\n<li> Cộng tiềm năng cho tất cả : max 120</li>\r\n<li> Cộng thêm tiềm năng : max 30% </li>\r\n<li>  Tấn công : max 5000</li>\r\n</ul>'),
(204, 'post06', ' </ul>\r\n\r\n<em style=\"color: rgb(161, 0, 0);\">Đồ rơi boss ngoài</em>\r\n  <li>Đá 6789</li>\r\n  <li>Khí bảo</li>\r\n  <li>Lang bảo</li>\r\n  <li>Phiếu may mắn</li>\r\n  <li>Sách võ công 8x</li>\r\n	<li>Đồng xu random ra lượng</li>\r\n<em style=\"color: rgb(161, 0, 0);\">Đồ rơi boss vdmq</em>\r\n  <li>Bát bảo</li>\r\n  <li>Rương bạch ngân</li>\r\n  <li>Sách võ công 100</li>\r\n  <li>Đá 89,10,11,12</li>\r\n  <li>Siêu xe</li>\r\n	<li>Đồng xu random ra lượng</li>\r\n<em style=\"color: rgb(161, 0, 0);\">Đồ rơi boss làng truyền thuyết</em>\r\n  <li>Pha lê</li>\r\n  <li>Hoa tuyết</li>\r\n  <li>Nham thạch</li>\r\n  <li>Bát bảo</li>\r\n  <li>Rương bạch ngân</li>\r\n  <li>Siêu xe</li>\r\n  <li>Giấy phép nâng cấp ấn tộc</li>\r\n<em style=\"color: rgb(161, 0, 0);\">Đồ rơi boss lãnh địa gia tộc</em>\r\n  <li>Đá cấp 8910</li>\r\n  <li>Đá linh hồn</li>\r\n  <li>Bụi linh hồn</li>\r\n  <li>Trượng linh hồn</li>\r\n</ul>'),
(205, 'post07', '<em style=\"color: rgb(161, 0, 0);\">1 . Danh Hiệu Vip :</em><br>\r\n<b>Hạng Kim Cương<br>\r\nĐại Gia<br>\r\nGia Tộc Huyền Thoại<br></b>\r\n\r\n  <li>Hp tối đa +5000</li>\r\n  <li>Tấn công +5000</li>\r\n  <li>Chí mạng +50</li>\r\n  <li>Tấn công +40%</li>\r\n	\r\n	<em style=\"color: rgb(161, 0, 0);\">2 . Danh Hiệu Khá :</em><br>\r\n<b>Hạng Vàng<br>\r\nTop Server<br>\r\nGia Tộc Minh Mẫn<br></b>\r\n\r\n  <li>Hp tối đa +4000</li>\r\n  <li>Tấn công +4000</li>\r\n  <li>Chí mạng +40</li>\r\n  <li>Tấn công +20%</li>\r\n	\r\n	<em style=\"color: rgb(161, 0, 0);\">3 . Danh Hiệu Thường :</em><br>\r\n<b>Hạng Bạc<br>\r\nFan Cứng<br>\r\nTrùm VXMM<br>\r\nGia Tộc Siêng Năng<br></b>\r\n\r\n  <li>Hp tối đa +2000</li>\r\n  <li>Tấn công +2000</li>\r\n  <li>Chí mạng +30</li>\r\n  <li>Tấn công +10%</li>'),
