(217, 'gioithieu', '<div class=\"mx-2 fs-6\">Ninja school là một tựa game tuổi thơ của bao thế hệ 8x 9x, đến nay Ninja School\n                    đã hơn 10 năm nhưng độ hot chưa từng giảm <br><br>Bạn muốn quay lại với những năm tháng tuổi thơ đó\n                    thì không cần đi đâu xa ,tôi sẽ giúp các bạn làm điều đó. Tổng 6 môn phái cho bạn tha hồ lựa\n                    chọn:Kunai,Kiếm,Đao,Cung,Tiêu,Quạt với các nhân vật anh hùng nửa tránh nửa tà, có hành tung bí ẩn và\n                    các năng lực phi thường<br><br>\n                    <ul>\n                        <li>Ookaza học sinh hệ Thủy gây đóng băng</li>\n                        <li>Haruna học sinh hệ Phong gây choáng váng</li>\n                        <li>Hirosaki học sinh hệ Hỏa gây bỏng rát</li>\n                    </ul>\n                    Nếu muốn làm bạn thì cùng nhau vô hang động, còn có ý phản động thì cùng nhau vào chiến\n                    trường<br><br>*Lời nói của ADMIN: Đây là server được mở ra dành cho anh em fangame trải nghiệm tuổi\n                    thơ, không nhằm mục đích kinh doanh, lôi kéo người chơi. Các bạn lưu ý kĩ trước khi trải nghiệm !\n                </div>'),
