(87, 3, 'Băng Hổ Bạch Long', 1, 1, 26019, 'Băng thuật tối thượng - Tạo ra hàng loạt vụ nổ năng lượng nhắm thẳng vào mục tiêu', '[{\"skillId\":959,\"maxFight\":0,\"dx\":0,\"level\":120,\"dy\":0,\"manaUse\":0,\"options\":[{\"param\":0,\"id\":25},{\"param\":0,\"id\":0},{\"param\":0,\"id\":3},{\"param\":0,\"id\":11},{\"param\":0,\"id\":33}],\"point\":0,\"coolDown\":0},{\"skillId\":960,\"maxFight\":6,\"dx\":90,\"level\":120,\"dy\":46,\"manaUse\":140,\"options\":[{\"param\":10,\"id\":25},{\"param\":550,\"id\":0},{\"param\":5500,\"id\":3},{\"param\":770,\"id\":11},{\"param\":300,\"id\":33}],\"point\":1,\"coolDown\":300}]'),
(88, 4, 'Tiễn Ưng Vĩnh Cửu', 1, 1, 26020, 'Đưa Băng Chakra vào mũi tên, khi chạm đến mục tiêu sẽ phát nổ tạo ra một quả cầu năng lượng nhắm thẳng đến mục tiêu', '[{\"skillId\":961,\"maxFight\":0,\"dx\":0,\"level\":120,\"dy\":0,\"manaUse\":0,\"options\":[{\"param\":0,\"id\":25},{\"param\":0,\"id\":1},{\"param\":0,\"id\":3},{\"param\":0,\"id\":11},{\"param\":0,\"id\":33}],\"point\":0,\"coolDown\":0},{\"skillId\":962,\"maxFight\":7,\"dx\":140,\"level\":120,\"dy\":140,\"manaUse\":280,\"options\":[{\"param\":11,\"id\":25},{\"param\":520,\"id\":1},{\"param\":5000,\"id\":3},{\"param\":780,\"id\":11},{\"param\":300,\"id\":33}],\"point\":1,\"coolDown\":330}]'),
(89, 5, 'Vũ Đao Thiên Lôi', 1, 1, 26021, 'Phong lôi thần thuật, Triệu hồi thiên lôi nhắm thẳng vào mục tiêu gây 1 lượng sát thương cực lớn', '[{\"skillId\":963,\"maxFight\":0,\"dx\":60,\"level\":120,\"dy\":60,\"manaUse\":0,\"options\":[{\"param\":0,\"id\":26},{\"param\":0,\"id\":0},{\"param\":0,\"id\":4},{\"param\":0,\"id\":11},{\"param\":0,\"id\":33}],\"point\":0,\"coolDown\":0},{\"skillId\":964,\"maxFight\":6,\"dx\":90,\"level\":120,\"dy\":46,\"manaUse\":160,\"options\":[{\"param\":10,\"id\":26},{\"param\":550,\"id\":0},{\"param\":5500,\"id\":4},{\"param\":800,\"id\":11},{\"param\":300,\"id\":33}],\"point\":1,\"coolDown\":330}]'),
(90, 6, 'Thuật Phiến Cuồng Phong', 1, 1, 26022, 'Phiến thuật Phong Lôi - Triệu hồi thiên lôi tấn công thẳng vào mục tiêu gây ra sát thương cực lớn', '[{\"skillId\":965,\"maxFight\":0,\"dx\":120,\"level\":120,\"dy\":100,\"manaUse\":0,\"options\":[{\"param\":0,\"id\":26},{\"param\":0,\"id\":1},{\"param\":0,\"id\":4},{\"param\":0,\"id\":11},{\"param\":0,\"id\":33}],\"point\":0,\"coolDown\":0},{\"skillId\":966,\"maxFight\":7,\"dx\":120,\"level\":120,\"dy\":100,\"manaUse\":300,\"options\":[{\"param\":11,\"id\":26},{\"param\":580,\"id\":1},{\"param\":5000,\"id\":4},{\"param\":780,\"id\":11},{\"param\":350,\"id\":33}],\"point\":1,\"coolDown\":330}]');
